import "../../Sass/_avaliacoes.scss";
import { Container, Row, Col, Form } from 'react-bootstrap';
import React from 'react';
import Pagination from 'react-bootstrap/Pagination';

const Avaliacoes = () => {
    return (
        <>
            <Container className="cont2">

                <Row className="row">
                    <Col id="pg-prev">
                        <Pagination>
                            <Pagination.Prev href="/avaliacoes">Voltar</Pagination.Prev>
                        </Pagination>
                    </Col>
                </Row> 

                <Row className="row">
                    <Col>
                        <Form>
                            <h3>A opção principal estava:</h3>
                            {['radio'].map((type) => (
        <div key={`inline-${type}`} className="mb-4">
          <Form.Check
            inline
            label="Excelente"
            name="group3"
            type={type}
            id={`inline-${type}-4`}
          />
          <Form.Check
            inline
            label="Bom"
            name="group3"
            type={type}
            id={`inline-${type}-5`}
          />
          <Form.Check
            inline
            label="Normal"
            name="group2"
            type={type}
            id={`inline-${type}-6`}
          />
          <Form.Check
            inline
            label="Ruim"
            name="group2"
            type={type}
            id={`inline-${type}-7`}
          />
          <Form.Check
            inline
            label="Horrível"
            name="group2"
            type={type}
            id={`inline-${type}-8`}
          />
          
        </div>
      ))}


                        </Form>
                    </Col>
                </Row>

                <Row className="row">
                    <Col id="pg-next">
                        <Pagination>
                            <Pagination.Next href="/avaliacoes/principal">Próximo</Pagination.Next>
                        </Pagination>
                    </Col>
                </Row>

            </Container>
        </>
    );
}

export default Avaliacoes;
